import React from "react"
import axios from "axios"


export default class Australia extends React.Component {
    state = {
        city: []
    };
    componentDidMount() {
        axios.get(`http://localhost:2500/importantCities`)
          .then(res => {
            const city = res.data;
            this.setState({ city });
          })
      }

      render() {
        if (this.state.city.citiesInstance === undefined) {
          return <h1>Not here</h1>;
        }

        return (

          <p>
            {this.state.city.citiesIntance
            .filter(city=> city.continent === "Australia")
            .map(city=> <h1 key={city.id}>{city.name}</h1> )}


          </p>
        )
      }
    }
